DALILA forever 


alila, born in Casablanca, Morocco, in 1968, was quite popular in Europe during the 1990s and early 2000s, performing in 58 films, and receiving 18 nominations and 12 awards at the European X and Venus Awards in Brussels and Berlin. She was active from 1993 on and retired aboout in 2001. 
